import {PSO} from "./pso.js";
import  math from "mathjs";
import RadialProgressBar from 'vue-radial-progress';


export default {
	data() {
		return {
			value: ' ',
			number: '',
			number2: '',
      selected: '',
      th: '',
      dim: '',
      func: '',
      dimensions: '',
      completedSteps: 0,
      totalSteps: 10

		};
	},
	methods: {
    onChange: function(event,th) {
      evento = event.target.value

      switch (evento) {
              case 'Sphere':
              this.th = 'sphere';
              console.log(this.th);
              break;

              case 'Levi':
              this.th = 'levi';
