              this.th = 'schwefel';
              console.log(this.th);
              break;


            default:
              console.log("Selecione uma função válida!");
            }        
    },     
        pso1: function(th, dim){
            var pso = new PSO({
                dimensions: 2,
                func: this.th// determina a função a ser utilizada
            });
            console.log(pso.func);
            console.log(pso.dimensions);
            var maxIteration = 100;
            var iterations = maxIteration;
               // variáveis gráfico (inicio)
            var trace = {
                      x: math.zeros(pso.size)._data,
                      y: math.zeros(pso.size)._data,
                      mode: 'markers',
                      type: 'scatter'
                    };

            var trace1 = {
                      x: math.zeros(pso.size)._data,
                      y: math.zeros(pso.size)._data,
                      mode: 'markers',
                      type: 'scatter'
                    };

            var data = [trace1];

            var layout = {
                title: 'Andamento dos dados'
            }
            Plotly.newPlot('graph', data, layout) 
               // variáveis gráfico (fim)

            function nextStep(){
                if (--iterations==0){
                    pso.reset();
                    iterations = maxIteration;
                }
                //imprimindo gráfico (inicio)
                let pontosx = math.zeros(pso.size)._data
                let pontosy = math.zeros(pso.size)._data

                for(var j2 = 0; j2 < pso.size; j2++){
                  pontosx[j2] = pso.positions[j2][0]
                  pontosy[j2] = pso.positions[j2][1]               
                }


                 Plotly.animate('graph', {
                   data: [{x: pontosx, 
                           y: pontosy}],
                           traces: [0],
