                  }, {
                   transition: {
                      duration: 500,
                      easing: 'cubic-in-out'
                    },
                    frame: {
                      duration: 500
                    }
                  })
                //imprimindo gráfico (fim)
                pso.step();
                setTimeout(nextStep, 200);        
            }
            nextStep();   
        }     
  }
};
